INSERT INTO `tbl_content` VALUES (1,3,2,'1','This is the content','Rejected','This is title',6,'2022-04-26',1),(2,3,2,'1','This is the content','Rejected','This is title',7,'2022-04-16',2),(3,3,2,'data:image/jpeg;base64,','how are you','Rejected','here is it',7,'2022-04-11',5),(4,3,2,'data:image/jpeg;base64,','how are you','Rejected','here is it',6,'2022-04-02',3),(5,3,2,'data:image/jpeg;base64,','story is this','Rejected','THIS IS TITLE',8,'2022-04-13',2),(6,3,2,'data:image/jpeg;base64,','story is this','Pending','THIS IS TITLE',6,'2022-05-06',1),(7,3,2,'data:image/jpeg;base64,','djflkdsjflkd','Pending','HELLO',6,'2022-04-02',5),(8,3,2,'data:image/jpeg;base64,','dfdfdfd','Pending','dfdf',6,'2022-04-03',4),(10,3,2,'data:image/jpeg;base64,','story can be here','Pending','title is this',6,'2022-04-18',3),(12,3,2,'data:image/jpeg;base64,','what can he ','Rejected','what is this',6,'2022-04-28',1),(15,3,1,'data:image/jpeg;base64,','JavaScript is a scripting or programming language that allows you to implement complex features on web pages — every time a web page does more than just sit there and display static information for you to look at — displaying timely content updates, interactive maps, animated 2D/3D graphics, scrolling video jukeboxes, etc. — you can bet that JavaScript is probably involved. It is the third layer of the layer cake of standard web technologies, two of which (HTML and CSS) we have covered in much more detail in other parts of the Learning Area.\n\nWhat is even more exciting however is the functionality built on top of the client-side JavaScript language. So-called Application Programming Interfaces (APIs) provide you with extra superpowers to use in your JavaScript code.\n\nAPIs are ready-made sets of code building blocks that allow a developer to implement programs that would otherwise be hard or impossible to implement. They do the same thing for programming that ready-made furniture kits do for home building — it is much easier to take ready-cut panels and screw them together to make a bookshelf than it is to work out the design yourself, go and find the correct wood, cut all the panels to the right size and shape, find the correct-sized screws, and then put them together to make a bookshelf.','Accepted','JAVASCRIPT AND THE FUTURE',10,'2022-04-27',4),(17,9,2,'data:image/jpeg;base64,','REDDIS is the thing that can be used in the embassy of america with beautiful intensifying way of tragical calamities.','Rejected','REDDIS',6,'2022-04-06',6),(19,3,2,'data:image/jpeg;base64,','Worker has lost their job due to the contamination of the issue in the beautiful places is very super in the supreme authority of authorization','Rejected','WORKER LOST',6,'2022-04-06',2),(21,3,3,'data:image/jpeg;base64,','Himalayas, Nepali Himalaya, great mountain system of Asia forming a barrier between the Plateau of Tibet to the north and the alluvial plains of the Indian subcontinent to the south. The Himalayas include the highest mountains in the world, with more than 110 peaks rising to elevations of 24,000 feet (7,300 metres) or more above sea level. One of those peaks is Mount Everest (Tibetan: Chomolungma; Chinese: Qomolangma Feng; Nepali: Sagarmatha), the world’s highest, with an elevation of 29,032 feet (8,849 metres; see Researcher’s Note: Height of Mount Everest. The mountains’ high peaks rise into the zone of perpetual snow.\n\nFor thousands of years the Himalayas have held a profound significance for the peoples of South Asia, as their literature, mythologies, and religions reflect. Since ancient times the vast glaciated heights have attracted the attention of the pilgrim mountaineers of India, who coined the Sanskrit name Himalaya—from hima (“snow”) and alaya (“abode”)—for that great mountain system. In contemporary times the Himalayas have offered the greatest attraction and the greatest challenge to mountaineers throughout the world.','Accepted','HIMALAYAS',1,'2022-04-04',3),(27,10,3,'data:image/jpeg;base64,','Mountain, landform that rises prominently above its surroundings, generally exhibiting steep slopes, a relatively confined summit area, and considerable local relief. Mountains generally are understood to be larger than hills, but the term has no standardized geological meaning. Very rarely do mountains occur individually. In most cases, they are found in elongated ranges or chains. When an array of such ranges is linked together, it constitutes a mountain belt. For a list of selected mountains of the world, see below.\n\nA mountain belt is many tens to hundreds of kilometres wide and hundreds to thousands of kilometres long. It stands above the surrounding surface, which may be a coastal plain, as along the western Andes in northern Chile, or a high plateau, as within and along the Plateau of Tibet in southwest China. Mountain ranges or chains extend tens to hundreds of kilometres in length. Individual mountains are connected by ridges and separated by valleys. Within many mountain belts are plateaus, which stand high but contain little relief. Thus, for example, the Andes constitute a mountain belt that borders the entire west coast of South America; within it are both individual ranges, such as the Cordillera Blanca in which lies Peru’s highest peak, Huascarán, and the high plateau, the Altiplano, in southern Peru and western Bolivia.','Rejected','MOUNTAINS',0,'2022-04-14',1),(28,4,3,'data:image/jpeg;base64,','Tell your hfhhfhuhdfjahsdjf akjfjasd hvjhslkjabl hslfhjdsfh','Accepted','AS THE MOUNTAIN SPEAKS',2,'2022-04-05',2),(29,4,3,'data:image/jpeg;base64,','Maruthvamala is located in Kanniyakumari district. Situated at the south most tip of the Indian peninsula, it is surrounded by the bay of Bengal in the East, the Indian Ocean in the South and the Arabian Sea on the west. The name Maruthwamala originates from the Tamil ‘marunthu vazhum malai’ ','Rejected','MARUTHVAMALA',1,'2022-04-23',2),(32,4,2,'data:image/jpeg;base64,','asdfasfdasd','Pending','asdfasdf',0,'2022-04-09',3),(33,4,2,'data:image/jpeg;base64,','in my last incarnation i inoculated myself\nwith oodles of dago red and stumbled into fame\nwithout falling. i worshipped in the temple of Lady Day\nand took Coltrane as my wizard. i always wore my mink coat\nto the Laundromat and drank pale champagne with my\n\nsoft-boiled eggs. i believed King Kong got a raw deal.\ni believe great and prolonged sex cured cancer. i believed\nin the afterdeath. i was liberator of cough-and-gaggers\nfrom the cages of their spew. i scavenged rusted auto parts,\nbuilt a niggah machine, loaded it with atomic amour and\n\nwiped out all purveyors of poverty. . . swapped my pink\npearl for a black sapphire. and then one quincentennial\ni rose from the magnificent effluvium of my jazz\nto discover my children did not know me','Accepted','American Sonnet 51',1,'2022-05-08',2);
