INSERT INTO `tbl_contestpost` VALUES (1,4,'data:image/jpeg;base64,','Stroy','Accepted','TITLE',0,'2022-04-09',1,0),(2,4,'data:image/jpeg;base64,','People move from one country to another, and in itself, this isn\'t a social problem. However, immigration can place stress on government programs and social systems within a country, and it can be a divisive topic in a society. These immigration-related stresses affect many people.\n\nFor instance, the Pew Research Center reports that the United States has more immigrants than any other country; 13.6% of the U.S. population identifies as an immigrant. This is a divisive issue in the U.S. population, with some groups calling for stricter immigration laws. Although the majority of U.S. citizens welcome immigrants, a 2019 Gallup poll indicates 23% of people think immigration is the most important social issue facing the country.','Accepted','Immigration Stresses',1,'2022-04-13',10,3),(3,10,'data:image/png;base64,','Civil rights, or the rights of citizens in a country to have equal treatment socially and politically, is another one of the most significant social issues in America and around the world. More than 40 years after the Civil Rights Act passed, almost 60% of African Americans still live in segregated neighborhoods and 90% of African Americans report that racial discrimination is still a major problem.\n\nHowever, the childhood obesity epidemic doesn\'t affect all children equally. Children in families where the parents have more education and higher incomes are far less likely to be obese than those in families with less education and lower incomes.','Accepted','Civil Rights and Racial Discrimination',2,'2022-04-13',10,4),(4,6,'data:image/png;base64,','As the population of the world grows, resources become scarcer. The United Nations reports that the current population of 7.7 billion people is expected to grow in coming decades, with a projection of 8.5 billion people by 2030.\n\nThe fastest growing areas of the world, such as sub-Saharan Africa, often face already scarce resources like land for farming. As the population becomes more than the country can sustain, people will need to move elsewhere to avoid starvation and homelessness.','Winner','Overpopulation',5,'2022-04-13',2,0),(5,4,'data:image/jpeg;base64,','This is a biased phase of system in the whole world with the basic freedom.','Accepted','Biased Phase',2,'2022-04-09',2,0);
